import React from 'react';

export default class Reg extends React.Component {
  state = {
    nm: '',
    fr: '',
    em: '',
    ps: '',
    ph: '',
  };

  Reg = (eve) => {
    eve.preventDefault();
    this.props.Reg(
      this.state.nm,
      this.state.fr,
      this.state.em,
      this.state.ps,
      this.state.ph
    );
  };
  changeName = (ev) => {
    this.setState({ nm: ev.target.value });
  };
  changeFrstname = (ev) => {
    this.setState({ fr: ev.target.value });
  };
  changeEmail = (ev) => {
    this.setState({ em: ev.target.value });
  };
  changePassword = (ev) => {
    this.setState({ ps: ev.target.value });
  };
  changePhone = (ev) => {
    this.setState({ ph: ev.target.value });
  };

  render() {
    return (
      <form onSubmit={this.Reg}>
        {' '}
        <input type='text' placeholder='Name' onChange={this.changeName} />
        <input
          type='text'
          placeholder='Frstname'
          onChange={this.changeFrstname}
        />
        <input type='email' placeholder='Email' onChange={this.changeEmail} />
        <input
          type='password'
          placeholder='Password'
          minLength='6'
          onChange={this.changePassword}
        />
        <input type='tel' placeholder='phone' onChange={this.changePhone} />
        <a href='#Log'>
          {' '}
          <button>
            <b> Login in</b>
          </button>
        </a>
      </form>
    );
  }
}
